import React from "react";
import "../../normalize.scss";
import "../../base.scss";
import DadosUsuario from "../../components/Cadastro/DadosUsuario";
import View from "../view/view";
import { Redirect } from "react-router";

function DadosUser(props) {
  const iscadastro = props.history.location.state.email;
  console.log(iscadastro)

  if(!!iscadastro) {
    return <Redirect/>
  }

  return (
      <View cadastro={true}>
        <DadosUsuario />
      </View>
    )
}

export default DadosUser;
